      So I'm with the girls this week, Talking about girl stuff, taking silly pictures and taking a ride down to the local 
Coffee Shop for some more girl time. When Megan spots this dude sitting alone behind us. She quickly caught his attentions 
and asked him why he was alone. Then the girls jumped in and asked him if he had a place to crash and chill. He gave us an 
address to his crib and told us to meet him there. Before we rode out we went to the liqueur store and found a really tall 
looking basket ball type dude and we quickly scooped him up. Took the girls back to the crib and guess what we found out... 
these girls are fucking hot and not to be missed out!

